// import './blog-home.css';
// import '../blog.css';
import Blog_i from "../../../Assets/Objectives_Images/Climate.jpg";
const Blog_home = () => {
    return (  
       <div className="blog-home-container">
        <div className="blog-home-container-in">
            <div className="home-in-one">
            <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Praesent euismod, nunc eu venenatis ultricies, ex nisi sollicitudin metus, id gravida nisi mi eget mi. Proin id justo nec lacus pretium egestas. Sed vehicula lectus sed sagittis ullamcorper. Fusce eget risus sed nisl lacinia vestibulum. Vivamus consectetur diam nec augue vehicula, id fermentum dui aliquet. Sed mollis neque nec dui blandit, sit amet cursus ligula feugiat. Curabitur non risus nec risus bibendum pulvinar.</p>
            <p>Mauris blandit elit eget ligula suscipit, at ultrices tortor posuere. Donec tincidunt, odio nec varius vulputate, ipsum purus eleifend libero, sit amet sodales ex dolor nec sapien. Integer interdum, nisl ac dignissim congue, orci nulla gravida nulla, nec ultricies lacus ex nec nulla. Vestibulum tincidunt lectus eget lorem efficitur, at consectetur ex suscipit. Nulla facilisi. Donec aliquet risus ac justo pellentesque ultricies. Etiam facilisis ligula nec augue bibendum dapibus. Integer mollis, sem sed feugiat lacinia, justo libero condimentum libero, non euismod elit odio eget augue.</p>
            </div>
            <div className="home-in-image">
                <img src={Blog_i} alt="Blog Visual" className='blog_image' />
            </div>
        </div>
       </div>
    );
}

export default Blog_home;
